/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import Nav from "../components/Nav";
import Dune from "../images/dune.jpg";
import CircleText from "../components/CircleButton";
import React from "react";
import "./home.scss";
import CircleButton from "../components/CircleButton";

const tablet = `@media (max-width: 800px)`;
const mobile = `@media (max-width: 500px)`;

const HomeBackground = styled.div`
  background: url(${Dune}) no-repeat center center fixed;
  background-size: cover;
  font-size: 24px;
  color: white;
  font-weight: bold;
`;

const HomeDiv = styled.div`
  border-style: solid;
  border-width: 2px;
  border-color: #aeff00;
  bottom: 0;
  margin: 0px 30px;
`;

const DuneImg = styled.img`
  background-color: ${({ theme }) => theme.color.jasper500};
  width: 700px;
  margin: 0 auto;
  ${tablet} {
    padding: 60px 40px;
  }
  ${mobile} {
    padding: 80px 0 80px 130px;
  }
`;

function Home() {
  return (
    <HomeBackground>
      <HomeDiv>
        <Nav />
        <p>John Schriemer</p>
        <CircleButton />
      </HomeDiv>
    </HomeBackground>
  );
}

export default Home;
